  \"2015-06-17T01:56:43.857446\",\n\t\"name\": \"fur-seal-investigations-1966\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Annually a report is made on the fur seal
  investigations carried on by the Bureau of Commercial Fisheries on the Pribilof
  Islands and at sea. Investigations on the islands are directed mainly toward the
  development of a rational system for holding the seal population at the level of
  maximum productivity. At sea, the original motivations for research were the problems
  of fur seal predation on commercially important fishes and the intermingling of
  seals from the eastern and western Pacific Ocean. It is unlikely that unequivocal
  conclusions can be reached soon on either problem. Report details may aspect of
  fur seal life history.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
